OpcUa_StatusCode ProjectSettingDataTypes::setProjectSettingDataTypes(OpcUa_Variant &variant, OpcUa_Boolean bDetach)
{
    clear();

    OpcUa_StatusCode ret = OpcUa_BadTypeMismatch;
    if (variant.Datatype == OpcUaType_ExtensionObject &&
        variant.ArrayType == OpcUa_VariantArrayType_Array)
    {
        ret = OpcUa_Good;
        m_noOfElements = variant.Value.Array.Length >= 0 ? variant.Value.Array.Length : 0;
        if (m_noOfElements > 0 && variant.Value.Array.Value.ExtensionObjectArray != OpcUa_Null)
        {
            m_data = (MoxaClassBased_ProjectSettingDataType*)OpcUa_Alloc(m_noOfElements * sizeof(MoxaClassBased_ProjectSettingDataType));

            OpcUa_UInt32 i = 0;
            for (i = 0; i < m_noOfElements; i++)
            {
                MoxaClassBased_ProjectSettingDataType_Initialize(&m_data[i]);

                MoxaClassBased_ProjectSettingDataType *pValue = MOXACLASSBASED_EXTENSIONOBJECT_GET_ENCODEABLE(ProjectSettingDataType, &variant.Value.Array.Value.ExtensionObjectArray[i]);
                if (pValue)
                {
                    if (bDetach != OpcUa_False)
                    {
                        m_data[i] = *pValue;
                        MoxaClassBased_ProjectSettingDataType_Initialize(pValue);
                    }
                    else
                    {
                        MoxaClassBased_ProjectSettingDataType_CopyTo(pValue, &m_data[i]);
                    }
                }
                else
                {
                    ret = OpcUa_BadTypeMismatch;
                    break;
                }
            }
            if (OpcUa_IsNotGood(ret))
            {
                for (OpcUa_UInt32 j = 0; j < i; j++)
                {
                    MoxaClassBased_ProjectSettingDataType_Clear(&m_data[j]);
                }
                OpcUa_Free(m_data);
                m_data = (MoxaClassBased_ProjectSettingDataType*)OpcUa_Null;
                m_noOfElements = 0;
            }
        }
        else
        {
            m_noOfElements = 0;
        }
    }
    return ret;
}

